    <style>

            overflow: hidden;

        span {
            display: inline-block;
        }

            text-wrap: wrap;
        }

            text-align: center;
        }

            transform-origin: center top;
        }

            text-align: right;

        }

        .al {
            text-align: left;
        }

        .al span {
            transform-origin: left top;
        }

        .b{
            font-weight: bold;
        }

        .i{
            font-style: italic;
        }

        .u{
            text-decoration: underline;
        }

        .s{
            text-decoration: line-through;
        }

        .dw{
            /* NOT FULLY SUPPORTED, NEED A BETTER IMPLEMENTATION */
            transform: scaleX(2);
        }

        .dh{
            /* NOT FULLY SUPPORTED, NEED A BETTER IMPLEMENTATION */
            transform: scaleY(2);
        }

        img {
            display: inline-block;
        }


    </style>
